import { Hero } from "../comps/Portal";

const Rules = () => {
  return (
    <>
      <Hero
        title="منشور امپراتوری کد"
        subtitle="برای پیوستن به امپراتوری کد از قوانین ما آگاه شو"
      />
    </>
  );
};

export default Rules;
